import React from 'react';
import ImageText from './ImageText';
import bg1 from './images/banner.jpg';
import bg2 from './images/banner2.png';
import './App.css';

function Body() {
  return (
    <div className="content-wrap">
      <ImageText id="#head" first="My name is" head="Michael Read" last="Welcome!" img={bg1} dark='true' btnBar='true'/>
      <ImageText img={bg2}/>
    </div>
  );
}

export default Body;
